import React from "react";
import Buttons from "./Buttons";

function Box({ quotes }) {
  return (
    <div id='quote-box' className='quote-box'>
      <div id='text'>
        <span>{quotes[0].quote}</span>
      </div>
      <div id='author'>
        <span>-John Doe</span>
      </div>
      <Buttons />
    </div>
  );
}

export default Box;
